 We can use React Context to create a global state for the Tooltip component.

## Create a Tooltip in NextJS using React Context

### 1. Create a Tooltip Context

Create a TooltipContext.js file in the components folder and add the following code.
```
import { createContext, useContext, useState } from "react";

const TooltipContext = createContext();

export const TooltipProvider = ({ children }) => {
  const [tooltip, setTooltip] = useState(null);

  return (
    <TooltipContext.Provider value={{ tooltip, setTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export const useTooltip = () => useContext(TooltipContext);
```
### 2. Create a Tooltip Component

Create a Tooltip.js file in the components folder and add the following code.
```
import { useTooltip } from "./TooltipContext";

const Tooltip = ({ children, text }) => {
  const { tooltip, setTooltip } = useTooltip();

  return (
    <div className="relative">
      {children}
      {tooltip && (
        <div
          className="absolute top-0 left-0 z-10 flex items-center justify-center w-48 h-48 bg-gray-100 rounded-lg shadow-lg"
          style={{ transform: "translate(-50%, -50%)" }}
        >
          <p className="text-sm text-gray-700">{text}</p>
        </div>
      )}
    </div>
  );
};

export default Tooltip;
```
### 3. Create a Tooltip Button Component

Create a TooltipButton.js file in the components folder and add the following code.
```
import { useTooltip } from "./TooltipContext";

const TooltipButton = ({ children, text }) => {
  const { setTooltip } = useTooltip();

  return (
    <div className="relative">
      <button
        className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded"
        onClick={() => setTooltip(text)}
      >
        {children}
      </button>
      {text && (
        <div
          className="absolute top-0 left-0 z-10 flex items-center justify-center w-48 h-48 bg-gray-100 rounded-lg shadow-lg"
          style={{ transform: "translate(-50%, -50%)" }}
        >
          <p className="text-sm text-gray-700">{text}</p>
        </div>
      )}
    </div>
  );
};

export default TooltipButton;
```
### 4. Create a Tooltip Wrapper Component

Create a TooltipWrapper.js file in the components folder and add the following code.
```
import { TooltipProvider } from "./TooltipContext";

const TooltipWrapper = ({ children }) => {
  return <TooltipProvider>{children}</TooltipProvider>;
};

export default TooltipWrapper;
```
### 5. Create a Tooltip Page

Create a TooltipPage.js file in the pages folder and add the following code.
```
import { TooltipWrapper } from "../components";

const TooltipPage = () => {
  return (
    <TooltipWrapper>
      <TooltipButton text="Tooltip 1">
        <span>Tooltip 1</span>
      </TooltipButton>
      <TooltipButton text="Tooltip 2">
        <span>Tooltip 2</span>
      </TooltipButton>
      <TooltipButton text="Tooltip 3">
        <span>Tooltip 3</span>
      </TooltipButton>
    </TooltipWrapper>
  );
};

export default TooltipPage;
```
